var aia__widget_version = '1.0.1';
var aia__widget_files_path = './';


define([
  `lib/components/base/modal`,
  aia__widget_files_path + 'classes/class.advanced_settings.js?v=' + aia__widget_version,
  aia__widget_files_path + 'classes/class.chats.js?v=' + aia__widget_version,
  aia__widget_files_path + 'includes/phone_mask/intlTelInput.min.js',
  aia__widget_files_path + 'includes/phone_mask/utils.js',
], function(Modal, AdvancedSettingsClass, ChatsClass) {

  var aiaClass = function() {

    var self = this;

    self.widget_code = 'aia_chatgpt_leadsbot';
    self.sync_settings_interval = null;
    self.tab_is_active = true;
    self.messagePollingInterval = null; // Variable to store the interval ID

    this.getTemplate = function(template, params, callback) {
      params = (typeof params == 'object') ? params : {};
      template = template || '';

      var base_path = self.params.path;

      return self.render({
        href: '/templates/' + template + '.twig',
        base_path: base_path,
        v: window[self.widget_code + '__widget_version'],
        load: callback
      }, params);
    }

    this.includeCSS = function(css_file) {

      var base_path = self.params.path;

      if (css_file.startsWith('http')) {
        var styles_path = css_file;
      } else {
        var styles_path = base_path + '/' + css_file + '?v=' + window[self.widget_code + '__widget_version'];
      }

      if ($('link[href="' + styles_path + '"').length < 1) {
        $("head").append('<link href="' + styles_path + '" type="text/css" rel="stylesheet">');
      }
    }

    this.fireModal = function(text, class_name) {
      return new Modal({
        class_name: class_name,
        init: function($modal_body) {
          $modal_body
            .trigger('modal:loaded')
            .html(text)
            .trigger('modal:centrify')
            .append('');

          //      
          $modal_body.bind('DOMSubtreeModified', function(e) {
            $(this).trigger('modal:centrify');
          });
        },
        destroy: function() {}
      });
    }

    this.addWidgetAreaClass = function($el) {

      let class_prefix = `${this.widget_code}__widget-area`;

      //     
      if ($el.attr('class')) {

        let classes = $el.attr('class').split(' ');

        $.each(classes, function(i, cl) {
          if (cl.startsWith(class_prefix))
            $el.removeClass(cl);
        });

      }

      //     
      $el.addClass(`${class_prefix}-${APP.getWidgetsArea()}`);
    }

    this.checkDnovWidgetInit = function() {

      return typeof dnov__check_widget_init !== 'undefined' && dnov__check_widget_init === true;

    }
    this.amoConfirm = function(params) {

      self.getTemplate('amo_confirm', {}, function(tmpl) {

        var $modal_content = tmpl.render({
          text: params.text,
          btn_name_confirm: params.btn_name_confirm,
          btn_name_cancel: params.btn_name_cancel,
          btn_confirm_blue: params.btn_confirm_blue,
        });

        var wrapper_class = self.widget_code + '__confirm_wrapper';

        var amo_confirm_modal = self.fireModal($modal_content, wrapper_class);

        setTimeout(function() {

          if (typeof params.callback_confirm !== 'undefined')
            $(`.${wrapper_class} .amo_custom_confirm__confirm_btn`).on('click', params.callback_confirm);

          if (typeof params.callback_cancel !== 'undefined')
            $(`.${wrapper_class} .amo_custom_confirm__cancel_btn`).on('click', params.callback_cancel);

          $(`.${wrapper_class} .amo_custom_confirm__confirm_btn, .${wrapper_class} .amo_custom_confirm__cancel_btn`).on('click', function() {
            amo_confirm_modal.destroy();
          });

        }, 100);

      });
    }
    const AccountSettings = function(account_data_path = '/api/account', onsave_path = '/api/onsave') {

      this.account_data_path = account_data_path;
      this.onsave_path = onsave_path;

      this.accountData = function() {
        var data = {},
          account = APP.constant('account'),
          user = APP.constant('user'),
          active_users = _.filter(APP.constant('managers'), function(i) {
            return i.active
          });
        admins = _.filter(APP.constant('managers'), function(i) {
          return i.is_admin == 'Y'
        });

        /** deprecated */
        data.user_id = user.id;
        data.domain = account.subdomain;
        data.users_count = active_users.length;
        data.admins = [];
        data.lang = APP.lang_id;

        $.each(admins, function(index, manager) {
          var admin = {
            id: manager.id,
            name: manager.title,
            email: manager.login,
            active: manager.active,
            is_admin: manager.is_admin
          }
          if (user.id == manager.id)
            admin.phone = user.personal_mobile;
          data.admins[index] = admin;
        });
        /* */

        // -- --
        data.account_id = account.id;
        data.tariffName = account.tariffName;
        data.paid_till = account.paid_till;
        data.current_user = {
          id: user.id,
          name: user.name,
          phone: user.personal_mobile,
          email: user.login
        }
        data.widget_area = APP.getWidgetsArea();

        return data;
      };

      this.sendAccountData = function(callback) {
        var data = this.accountData();

        return $.ajax({
          url: self.server_base_url + this.account_data_path,
          data: data,
          type: 'POST',
          success: function(response) {
            if (callback)
              callback(response);
          },
          error: function(jqXHR, error, errorThrown) {
            console.debug(jqXHR, error, errorThrown);
          },
          dataType: 'json'
        });
      };

      this.getWidgetTexts = function(callback) {
        let data = this.accountData();

        return $.ajax({
          url: self.server_base_url + '/api/widget_texts/' + self.widget_code,
          data: data,
          type: 'POST',
          success: function(response) {
            if (callback)
              callback(response);
          },
          error: function(jqXHR, error, errorThrown) {
            console.debug(jqXHR, error, errorThrown);
          },
          dataType: 'json'
        });
      };

      this.onSave = function(obj, callback) {

        self.TrackEvents.add('on_save_callback', self.get_settings());

        var data = this.accountData(),
          user = APP.constant('user');

        data.widget_active = obj.active;
        data.user_id = user.id;
        data.user_name = user.name;
        data.user_login = user.login;

        let $sf = self.Settings.getSearchField();
        if ($sf != null) {
          data.widgets_query = $sf.val();
          data.widgets_section = window.location.hash;
        }

        // Activate feedback text
        let $activate_feedback_field = $(`.${self.widget_code}__activate_with_feedback_textarea`);
        if ($activate_feedback_field.length > 0) {
          data.activate_feedback = $activate_feedback_field.val();
        }

        // Activate phone number
        let activate_phone_number = '';
        let $activate_phone_number_field = $(`.${self.widget_code}__activate_phone_number`);
        if ($activate_phone_number_field) {
          try {
            activate_phone_number = self.activate_phone_obj.getNumber(window.intlTelInputUtils.numberFormat.E164);
          } catch (e) {
            activate_phone_number = $activate_phone_number_field.val();
          }
        }
        data.activate_phone_number = activate_phone_number;

        // remove active class from save button if exists
        let $save_btn = $(`.${self.widget_code}__save_button_active`);
        if ($save_btn.length > 0)
          $save_btn.removeClass(`${self.widget_code}__save_button_active`);

        if (typeof self.TrackEvents !== 'undefined') {
          self.TrackEvents.add('on_save', data);
        }

        return $.ajax({
          url: self.server_base_url + this.onsave_path,
          data: data,
          type: 'POST',
          success: function(response) {
            if (callback)
              callback(response);
          },
          error: function(jqXHR, error, errorThrown) {
            console.debug(jqXHR, error, errorThrown);
            self.fireModal(self.i18n('txt.activate_error'), '');
          },
          dataType: 'json'
        });
      };


      /**
       * Send sync request to server
       * @param  {array} sync_types
       * @param  {function} callback
       * @return {promise}
       */
      this.sendSyncRequest = function(sync_types, callback) {

        try {
          let data = this.accountData();
          let widget_code = self.widget_code;

          return self.$authorizedAjax({
            url: self.server_base_url + `/api/widget/${widget_code}/sync-data`,
            data: {
              data: data,
              sync: sync_types
            },
            type: 'POST',
            success: function(response) {
              if (callback)
                callback(response);
            },
            error: function(jqXHR, error, errorThrown) {
              console.debug(jqXHR, error, errorThrown);
            },
            dataType: 'json'
          });
        } catch (e) {
          //
        }
      }

    }
    const TariffInfo = function() {

      this.tariff = null;

      this.render = function() {

        let $wrap = $(`.${self.widget_code}__tariff_info_wrap`);

        if ($wrap.length) {

          //       Salesbot,   
          if ($wrap.hasClass(`${self.widget_code}__tariff_info_salesbot`) && this.tariff.is_paid === true)
            return;

          $wrap.html(this.infoBlock());

          this.addClickHandler();
        }
      };

      this.addClickHandler = function() {

        let $tariff_info = $(`.${self.widget_code}__tariff_info`);

        $tariff_info.on('click', function() {

          let $wrap = $(`.${self.widget_code}__tariff_info_wrap`);

          if (!$wrap.hasClass(`${self.widget_code}__tariff_info_salesbot`))
            return;

          self.Settings.openSettingsModal('new_tab');
        });

      };

      this.wrapperBlock = function(additional_class) {

        additional_class = additional_class || '';

        return `<div class="${self.widget_code}__tariff_info_wrap ${additional_class}"></div>`;
      };

      this.infoBlock = function() {
        let text,
          tariff = this.tariff,
          class_name;

        if (tariff === null)
          return '';

        // different date format for ru and global
        let expire_at = ' ' + tariff.expire_at;
        if (self.i18n('txt') && self.i18n('txt.lang') != 'ru') {
          expire_at = ': ' + tariff.expire_at_human;
        }

        if (tariff.is_active === true) {
          if (tariff.type == 'start' || tariff.type == 'trial') {
            text = `     ${expire_at}`;

            // if localization available - use it
            if (self.i18n('txt') && self.i18n('txt.trial_license')) {
              text = self.i18n('txt.trial_license') + expire_at;
            }

            class_name = `${self.widget_code}__tariff_info--trial`;
          } else {
            text = `   ${expire_at}`;

            // if localization available - use it
            if (self.i18n('txt') && self.i18n('txt.paid_license')) {
              text = self.i18n('txt.paid_license') + expire_at;
            }

            class_name = `${self.widget_code}__tariff_info--active`;
          }
        }

        if (tariff.is_active === false) {
          text = `    ${expire_at}`;

          // if localization available - use it
          if (self.i18n('txt') && self.i18n('txt.expired_license')) {
            text = self.i18n('txt.expired_license') + expire_at;
          }

          class_name = `${self.widget_code}__tariff_info--expired`;
        }

        return `<div class="${self.widget_code}__tariff_info ${class_name}">${text}</div>`;
      };

      this.renderTariffInSettings = function($modal_body) {

        $modal_body.prepend(self.TariffInfo.wrapperBlock());

        self.AccountSettings.sendAccountData(function(response) {

          self.TariffInfo.updateTariff(response.tariff);

          if (self.platform == 'amocrm') {
            if (self.RatePublishedCb) {
              self.RatePublishedCb.renderMonthForReview(response.user_left_review);
            }
          }
        });
      };

      this.renderTariffInSalesbot = function($salesbot_body) {

          let $wrapper_html = self.TariffInfo.wrapperBlock(`${self.widget_code}__tariff_info_salesbot`);

          $salesbot_body.prepend($wrapper_html);

          self.AccountSettings.sendAccountData(function(response) {

            self.TariffInfo.updateTariff(response.tariff);

          });

        },

        this.updateTariff = function(tariff) {
          if (tariff) {
            self.TariffInfo.tariff = tariff;
            self.TariffInfo.render();
          }
        }
    }


    const Settings = function() {

      let auto_activate_interval;

      this.showTariffInfo = function($modal_body) {
        if (self.get_settings().status == 'installed') {
          self.TariffInfo.renderTariffInSettings($modal_body);
        }
      };

      //     
      this.autoActivateWidget = function($modal_body, after_seconds = 4) {

        var settings = self.get_settings();

        var $save_btn = $modal_body.find('.js-widget-save');

        if (settings.status == 'not_configured') {

          this.activate_seconds_remain = after_seconds;

          this.autoActivateCounter($save_btn);

          auto_activate_interval = setInterval(this.autoActivateCounter, 1000, $save_btn);
        }

      };

      //     
      this.autoActivateWidgetWithoutTimer = function($modal_body, after_seconds = 1) {

        var settings = self.get_settings();

        var $save_btn = $modal_body.find('.js-widget-save');

        if (settings.status == 'not_configured') {

          $save_btn.trigger('button:save:enable');

          setTimeout(function() {

            self.Settings.autoActivateWidget($modal_body, 0);

          }, after_seconds * 1000);
        }

      };

      this.autoActivateCounter = function($save_btn) {

        $save_btn.trigger('button:save:enable');

        if (self.Settings.activate_seconds_remain > 0) {

          let btn_txt = `  ${self.Settings.activate_seconds_remain} .`;

          if (self.i18n('txt.activation_in')) {
            btn_txt = `${self.i18n('txt.activation_in')} ${self.Settings.activate_seconds_remain} ${self.i18n('txt.seconds_short')}`;
          }

          $save_btn.find('.button-input-inner__text').text(btn_txt);
          self.Settings.activate_seconds_remain--;

        } else {

          clearInterval(auto_activate_interval);
          $save_btn.click();

        }
      };

      this.reopenSettingsAfterActivate = function(method = 'location_href') {

        //   ,    (      )
        if (self.get_settings().status == `not_configured`) {

          //       -   
          if (APP.getWidgetsArea() === 'widgetsSettings') {
            setTimeout(function() {
              self.Settings.openSettingsModal(method);
            }, 2000);
          }

        }
      };

      this.openSettingsModal = function(method = 'location_href') {

        if (method == 'amo_router') {

          let href = '/settings/widgets/#' + self.get_settings().widget_code;

          APP.router.navigate(href, {
            trigger: true
          });

        } else if (method == 'location_href') {

          let currentUrl = window.location.href;

          if (currentUrl.includes('settings/widgets')) {
            window.location.href = '/settings/widgets/#' + self.get_settings().widget_code;
            window.location.reload();
          } else {
            window.location.href = '/settings/widgets/#' + self.get_settings().widget_code;
          }

        } else if (method == 'new_tab') {

          window.open('/settings/widgets/#' + self.get_settings().widget_code, '_blank');

        }
      };

      this.showCompanyInfo = function($modal_body, response) {

        let class_name = `${self.widget_code}__settings_company_info`;

        $modal_body.append(`<div class="${class_name}"></div>`);

        let html = response.support_info;

        // replace links with twig buttons
        html = self.Settings.replaceLinksWithButtons(html);

        $(`.${class_name}`).append(html);

      };

      this.showPriceInfo = function($modal_body, response) {

        let class_name = `${self.widget_code}__settings_price_info`;

        $modal_body.append(`<div class="${class_name}"></div>`);

        let html = response.pricing_info;

        // replace links with twig buttons
        html = self.Settings.replaceLinksWithButtons(html);

        $(`.${class_name}`).append(html);
      };

      this.showDescriptionAfterInstall = function($modal_body, response) {

        if (self.get_settings().status == `installed`) {

          $wrapper = $modal_body.find('.widget_settings_block__descr');

          if ($wrapper) {
            let html = response.after_install;

            // replace links with twig buttons
            html = self.Settings.replaceLinksWithButtons(html);

            $wrapper.html(html);

            $(`.${self.widget_code}__settings_descr_show_more`).on('click', function(e) {
              e.preventDefault();
              $(this).hide();
              $(`.${self.widget_code}__settings_descr_hidden`).show('slow');
            });
          }

        }

      }

      this.getSearchField = function() {

        let $field = $('.amo-market-page>div>div>div input[type="text"]:first');
        if ($field.length == 0)
          $field = $('.content__settings-widgets .list-top-search .list-top-search__input');
        if ($field.length == 0)
          $field = null;

        return $field;
      }

      this.searchResults = function() {

        if (self.checkDnovWidgetInit())
          return;

        $(document).ajaxSuccess(function(event, xhr, options, response) {

          if (options.type == 'POST' && options.url.startsWith('/ajax/settings/widgets/search/')) {

            try {

              let data = options.data;
              let count = Object.keys(response.widgets).length;
              let code = self.widget_code ?? '';

              self.$authorizedAjax({
                url: self.server_base_url + `/api/widget/${code}/searchstat`,
                data: {
                  data: data,
                  count: count,
                },
                type: "POST",
              });

            } catch (e) {}

          }

        });

      }

      // Feedback form on activation
      this.activateWithFeedback = function($modal_body, feedback_field = true, phone_field = true) {

        let settings = self.get_settings();

        if (settings.status != 'not_configured')
          return;

        let $save_btn = $modal_body.find('.js-widget-save');

        self.getTemplate('settings_activate_with_feedback', {}, function(tmpl) {
          let html = tmpl.render({
            base_path: self.params.path,
            txt: self.i18n('txt'),
          });
          $('.widget_settings_block__descr').html(html);

          // Activate button on textarea or input change
          $(`.${self.widget_code}__activate_with_feedback_textarea, .${self.widget_code}__activate_with_feedback_input`).on('keyup change', function() {
            $save_btn.addClass(`${self.widget_code}__save_button_active`);
          });

          // If feedback field is disabled - remove it
          if (feedback_field == false) {
            $(`.${self.widget_code}__activate_with_feedback_field_text`).remove();
          }

          // If phone field is disabled - remove it
          if (phone_field == false) {
            $(`.${self.widget_code}__activate_with_feedback_field_phone`).remove();
          }

          if (phone_field && self.PhoneMask) {
            self.activate_phone_obj = self.PhoneMask.init(`.${self.widget_code}__activate_phone_number`);

            let user_personal_phone = APP.constant('user').personal_mobile ?? '';
            if (user_personal_phone != '') {
              try {
                self.activate_phone_obj.setNumber(user_personal_phone);
              } catch (e) {
                $(`.${self.widget_code}__activate_phone_number`).val(user_personal_phone);
              }

              // as only phone field left and it's filled - activate button
              if (feedback_field == false) {
                $save_btn.addClass(`${self.widget_code}__save_button_active`);
              }
            }

          }

          // Save button active by default
          $save_btn.addClass(`${self.widget_code}__save_button_active`);

        });

      }

      /**
       * Replace buttons with twig buttons 
       * like <a href="#" class="button blue">Ok</a> or <a href="#" class="button cancel_button">Cancel</a>
       * @param {string} html
       * @return {string}
       */
      this.replaceLinksWithButtons = function(html) {
        $(html).filter('.button').each(function() {
          let button = $(this);
          let button_text = button.text();
          let button_url = button.attr('href');
          let button_class = button.attr('class');
          let is_blue = button.hasClass('blue');

          let tpl = button.hasClass('cancel_button') ? 'cancel_button' : 'button';

          let twig_button_html = $(self.render({
            ref: `/tmpl/controls/${tpl}.twig`
          }, {
            text: button_text,
            class_name: button_class,
            blue: is_blue,
          }));

          // add on click to open in new tab if not cancel button
          if (!button.hasClass('cancel_button')) {
            if (button_url != undefined && button_url != '' && button_url != '#') {
              twig_button_html.attr('onclick', `window.open('${button_url}', '_blank');`);
            }
          }

          // add url to data-url attribute
          twig_button_html.attr('data-url', button_url);

          // replace with twig button
          html = html.replace(button.prop('outerHTML'), twig_button_html.prop('outerHTML'));
        });

        return html;
      }

    }


    const Notifications = function(server_url) {

      server_url = server_url || (self.server_base_url + '/api/notifications');

      this.check = function() {
          self.$authorizedAjax({
            url: server_url,
            type: "GET",
            success: function(response) {
              this.send(response.notifications);
            },
            error: function(jqXHR, error, errorThrown) {
              console.debug(jqXHR, error, errorThrown);
            }
          });
        },
        this.send = function(notifications) {
          notifications.forEach(function(item) {
            APP.notifications[item.method](item.params);
          });
        }
    }
    //    intlTelInput 'includes/phone_mask/intlTelInput.min.js'  'includes/phone_mask/utils.js'
    const PhoneMask = function() {
      this.init = function(selector) {
        const input = document.querySelector(selector);

        if (input) {
          try {
            return window.intlTelInput(input, {
              initialCountry: "auto",
              preferredCountries: ["us", "br", "mx", "pt", "es"],
              geoIpLookup: function(callback) {
                fetch("https://ipapi.co/json")
                  .then(function(res) {
                    return res.json();
                  })
                  .then(function(data) {
                    callback(data.country_code);
                  })
                  .catch(function() {
                    callback("us");
                  });
              },
            });
          } catch (e) {
            return null;
          }
        }

        return null;
      }
    }


    const Onboarding = function() {

      this.init = function() {

        let widget_code = self.get_settings().widget_code;

        // remove click event to avoid multiple onboarding
        $(document).off('click', `.${widget_code} .js-widget-save`);

        // On click on Save button
        $(document).on('click', `.${widget_code} .js-widget-save`, function() {

          // show onboarding after 2 sec
          setTimeout(function() {
            self.Onboarding.show();
          }, 2000);

        });

      };

      this.show = function() {
        self.AccountSettings.getWidgetTexts(function(response) {

          // if empty response.onboarding or not found
          if (!response.onboarding) {
            return false;
          }

          if (typeof self.TrackEvents !== 'undefined') {
            self.TrackEvents.add('onboarding_show');
          }

          let html = response.onboarding;

          // replace links with twig buttons
          html = self.Settings.replaceLinksWithButtons(html);

          html += self.Onboarding.getSupportInfo(response.support_info);

          let onboarding_modal = self.fireModal(html, `${self.widget_code}__onboarding_wrapper`);

          // Close onboarding on click cancel
          $(document).on('click', `.${self.widget_code}__onboarding_wrapper .button`, function(e) {
            e.preventDefault();
            if ($(this).hasClass('cancel_button')) {
              if (typeof self.TrackEvents !== 'undefined') {
                self.TrackEvents.add('onboarding_close');
              }
              onboarding_modal.destroy();
            } else {
              if (typeof self.TrackEvents !== 'undefined') {
                self.TrackEvents.add('onboarding_open_url', {
                  url: $(this).data('url'),
                });
              }
            }
          });

        });
      }

      /*
       * Get support info html
       * @param {string} support_info
       * @return {string}
       */
      this.getSupportInfo = function(support_info) {
        if (!support_info)
          return '';

        return `<div class="${self.widget_code}__onboarding_support">${support_info}</div>`;
      }

    }


    const TrackEvents = function() {

      this.add = function(event, metadata = null) {

        setTimeout(function() {
          try {
            let data = {
              amo_account_id: APP.constant('account').id,
              amo_user_id: APP.constant('user').id,
