                let controlsStyle = 'style="display: none;"'; // Hide controls initially

                // Only show status if it's loaded
                if (self.agent_status !== null) {
                    statusClass = self.agent_status ? 'active' : 'inactive';
                    statusText = self.agent_status ? self.parent.i18n('chats_ui.ai_agent_active') : self.parent.i18n('chats_ui.ai_agent_paused');
