        };

        // Setup bot control buttons functionality
        this.setupBotControls = function($tooltip) {
            let $stopBtn = $tooltip.find('.stop-bot-btn');
            let $resumeBtn = $tooltip.find('.resume-bot-btn');
            let $statusIndicator = $tooltip.find('.status-indicator');
            let $statusText = $tooltip.find('.status-text');

            $stopBtn.on('click', function() {
                // Logic to stop the bot

                // Update UI state proactively for better UX
                $statusIndicator.removeClass('active loading').addClass('inactive');
                $statusText.text(self.parent.i18n('chats_ui.ai_agent_paused'));

                // Hide stop button and show resume button
                $stopBtn.hide();
                $resumeBtn.show();

                // Send status update to server
                self.updateAgentStatus(false);

                // Prevent tooltip from closing immediately
                return false;
            });

            $resumeBtn.on('click', function() {
                // Logic to resume the bot

                // Update UI state proactively for better UX
                $statusIndicator.removeClass('inactive loading').addClass('active');
                $statusText.text(self.parent.i18n('chats_ui.ai_agent_active'));

                // Hide resume button and show stop button
                $resumeBtn.hide();
                $stopBtn.show();

                // Send status update to server
                self.updateAgentStatus(true);

                // Prevent tooltip from closing immediately
                return false;
            });
        };

        // Positions the tooltip relative to the button
        this.positionTooltip = function($button, $tooltip) {
            const buttonPos = $button.offset();
            const tooltipWidth = $tooltip.outerWidth();
            const tooltipHeight = $tooltip.outerHeight();
            const windowWidth = $(window).width();
            const windowHeight = $(window).height();

            // Calculate initial positions (above the button)
            let topPos = buttonPos.top - tooltipHeight - 10;
            let leftPos = buttonPos.left - (tooltipWidth / 2) + ($button.outerWidth() / 2);

            // Adjust horizontal position if tooltip would go off-screen
            if (leftPos < 10) {
                leftPos = 10; // Left edge padding
            } else if (leftPos + tooltipWidth > windowWidth - 10) {
                leftPos = windowWidth - tooltipWidth - 10; // Right edge padding
            }

            // If tooltip would go above the window, position it below the button instead
            if (topPos < 10) {
                topPos = buttonPos.top + $button.outerHeight() + 10;
            }

            $tooltip.css({
                top: topPos + 'px',
                left: leftPos + 'px'
            });
        };

        // Set up hover events for tooltip
        this.setupTooltipEvents = function($button, $tooltip) {
            // Create a flag to track hover state
            let isHovering = false;

            $button.on('mouseenter', function() {
                isHovering = true;
                self.positionTooltip($button, $tooltip);
                $tooltip.stop().fadeIn(200);
            });

            $button.on('mouseleave', function() {
                isHovering = false;
                // Use a small delay to allow time for the mouse to enter the tooltip
                setTimeout(function() {
                    if (!isHovering) {
                        $tooltip.stop().fadeOut(200);
                    }
                }, 500);
            });

            $tooltip.on('mouseenter', function() {
                isHovering = true;
            });

            $tooltip.on('mouseleave', function() {
                isHovering = false;
                setTimeout(function() {
                    if (!isHovering) {
                        $tooltip.stop().fadeOut(200);
                    }
                }, 500);
            });
        };

        // Common method to fetch all settings from server
        this.fetchSettings = function(callback) {
            // Prevent multiple simultaneous fetches
            if (this.is_fetching_settings) {
                return;
            }

            this.is_fetching_settings = true;

            return self.parent.$authorizedAjax({
                url: self.parent.server_app_base_url + '/api/chat/settings',
                data: self.parent.Chats.getCommonRequestData(),
                type: 'GET',
                success: function(response) {
                    self.is_fetching_settings = false;

                    if (response && response.success) {
                        // Store all settings
                        self.settings = response.settings || {};

                        // Extract specific settings
                        if (typeof response.settings?.ai_agent_is_active !== 'undefined') {
                            self.agent_status = response.settings.ai_agent_is_active;
                        }

                        // Update UI
                        self.updateSettingsUI();

                        // Execute callback if provided
                        if (typeof callback === 'function') {
                            callback(true);
                        }
                    } else {
                        console.error('Failed to fetch settings:', response?.message || 'Unknown error');

                        if (typeof callback === 'function') {
                            callback(false);
                        }
                    }
                },
                error: function(jqXHR, error, errorThrown) {
                    self.is_fetching_settings = false;
                    console.error('Error fetching settings:', error, errorThrown);

                    if (typeof callback === 'function') {
                        callback(false);
                    }
                },
                dataType: 'json'
            });
        };

        // Method to update all settings on the server
        this.updateSettings = function(updatedSettings, callback) {

            // TODO: When adding new settings, ensure that updating one setting does not overwrite other settings.



            // Create a data object with common request data
            let data = self.parent.Chats.getCommonRequestData();
            // Add all settings to be updated
            data.settings = updatedSettings;

            return self.parent.$authorizedAjax({
                url: self.parent.server_app_base_url + '/api/chat/settings',
                data: data,
                type: 'POST',
                success: function(response) {
                    if (response && response.success) {
                        // Update local settings with the updated values
                        Object.assign(self.settings, updatedSettings);

                        // Update agent_status if it was included in updates
                        if (typeof updatedSettings.ai_agent_is_active !== 'undefined') {
                            self.agent_status = updatedSettings.ai_agent_is_active;
                        }

                        // Update UI with new settings
                        self.updateSettingsUI();

                        // Execute callback if provided
                        if (typeof callback === 'function') {
                            callback(true);
                        }
                    } else {
                        console.error('Failed to update settings:', response?.message || 'Unknown error');

                        // Execute callback if provided
                        if (typeof callback === 'function') {
                            callback(false);
                        }

                        // Revert UI
                        self.updateSettingsUI();
                    }
                },
                error: function(jqXHR, error, errorThrown) {
                    console.error('Error updating settings:', error, errorThrown);

                    // Execute callback if provided
                    if (typeof callback === 'function') {
                        callback(false);
                    }

                    // Revert UI
                    self.updateSettingsUI();
                },
                dataType: 'json'
            });
        };

        // Update UI based on all current settings
        this.updateSettingsUI = function() {
            self.updateAgentStatusUI();
            self.updateRobotIcon(); // Update the robot icon based on status
            // Add more UI updates for future settings here
        };

        // Specific method to update agent status
        this.updateAgentStatus = function(isActive, callback) {
            return self.updateSettings({ ai_agent_is_active: isActive }, callback);
        };

        // Update UI based on current agent status
        this.updateAgentStatusUI = function() {
            let $button_class = `${self.parent.widget_code}__ai_agent_button`;
            let $tooltip = $(`.${$button_class}-tooltip`);

            if ($tooltip.length > 0) {
                let $stopBtn = $tooltip.find('.stop-bot-btn');
                let $resumeBtn = $tooltip.find('.resume-bot-btn');
                let $statusIndicator = $tooltip.find('.status-indicator');
                let $statusText = $tooltip.find('.status-text');
                let $botControls = $tooltip.find('.bot-controls');
                let $botStatus = $tooltip.find('.bot-status');

                // If status is still loading, show loading state
                if (self.agent_status === null) {
                    $statusIndicator.removeClass('active inactive').addClass('loading');
                    $statusText.text(self.parent.i18n('chats_ui.loading_status'));
                    $botControls.hide();
                    return;
                }

                // Show controls once we have the status
                $botControls.show();

                if (self.agent_status) {
                    // Agent is active
                    $statusIndicator.removeClass('inactive loading').addClass('active');
                    $statusText.text(self.parent.i18n('chats_ui.ai_agent_active'));
                    $stopBtn.show();
                    $resumeBtn.hide();
                } else {
                    // Agent is inactive/paused
                    $statusIndicator.removeClass('active loading').addClass('inactive');
                    $statusText.text(self.parent.i18n('chats_ui.ai_agent_paused'));
                    $stopBtn.hide();
                    $resumeBtn.show();
                }
            }
        };

    };

    return ChatButtonClass;
});

