                }
            });

            $('.js-control-contenteditable-amojo').addClass('event-listener-added');

        };


        // Start polling for new messages
        this.startMessagePolling = function () {
            // Clear any existing interval first
            self.stopMessagePolling();

            // Start a new interval
            self.parent.messagePollingInterval = setInterval(function () {
                self.loadMessage();
            }, POLLING_INTERVAL);
        };

        // Stop polling for new messages
        this.stopMessagePolling = function () {
