            // If the chats wrapper or actions wrapper is not visible, don't load the message
            if ($chats_wrapper.length == 0 || $actions_wrapper.length == 0)
                return;

            // If the chat is minimized, don't load the message
            if ($chats_wrapper.hasClass('minimized'))
                return;

            // If the last message is not incoming, don't load the copilot message
            if (!self.lastMessageIsIncoming())
                return;

            let $message_field = $chats_wrapper.find('.feed-compose__message'); // div contenteditable

            // If the message field is not empty, don't fetch new messages
            if ($message_field.text().trim().length > 0)
                return;

